import React from 'react';
import {Swiper,SwiperSlide} from 'swiper/react';
import {useState,useEffect} from 'react'
import axios from 'axios'
import Logo from './logo1.jpg'
import SwiperCore, { EffectCoverflow } from 'swiper';
import 'swiper/swiper-bundle.css';
SwiperCore.use([EffectCoverflow]);



function Testimonial(){
    const[data,setData]=useState([]);
    useEffect(()=>{
        axios.get("http://localhost:8000/testomonial/")
        .then(res=>{
          console.log(res)
          setData(res.data)
        })
        .catch(err=>{
          console.log(err)
        })

    })
   return (
    <Swiper 
    effect="coverflow"
    slidesPerView='auto'
    centeredSlides='true'
    >

    <SwiperSlide style={{width:"20rem",height:"23rem", display:"flex",flexWrap:"wrap"}} >
        {data.map(data=>(
             <div style={{width:"20rem",height:"23rem",boxShadow:" 1px 1px 5px gray",marginBottom:"1rem"}}>
             <img src={data.image} style={{width:"10rem",height:"10rem",left:"27%",top:"6%",position:"absolute",borderRadius:"50%"}}/>
             <div style={{position:"absolute",height:"7rem",width:"12rem",top:"50%",left:"25%",fontWeight:"600"}}>
                 <p> {data.message}</p>
             </div>
             </div>
        ))}
       
        
    </SwiperSlide>
  
    <SwiperSlide style={{width:"25rem",height:"25rem"}} >
        <img src={Logo} style={{width:"25rem",height:"25rem",}}></img>
    </SwiperSlide>
    <SwiperSlide style={{width:"25rem",height:"25rem"}} >
        <img src={Logo} style={{width:"25rem",height:"25rem",}}></img>
    </SwiperSlide>

  </Swiper>
      
    )
       
   
}

export default Testimonial;
